import { createSlice, PayloadAction } from "@reduxjs/toolkit";

const barberSlice = createSlice({
  name: "barbers",
  initialState: [
    { id: 1, name: "John Smith", specialty: "Fade & Beard", rating: 4.8 },
    { id: 2, name: "Mike Jones", specialty: "Classic Cuts", rating: 4.6 },
  ],
  reducers: {}
